local s = ""


local function string2binary(str)
    local len = string.len(str)
    local t = {}
    for i = 1, len - 1, 2 do
        t[#t+1] = tonumber(string.sub(str, i, i+1),16)
    end

    return string.char(table.unpack(t))
end

local function split_string(str)
    local len = string.len(str)
    local t = {}
    for i = 1, len - 1, 2 do
        t[#t+1] = string.sub(str, i, i+1)
    end
    return table.concat(t, " ")
end

